package q1840;

import java.util.Scanner;

public class Main {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		int a = sc.nextInt();
		int b = sc.nextInt();
		int n = 0;
		for(;;) {

		for (int i = 0; i < a; i++) {
			for (int j = 0; j < b; j++) {
				int c = sc.nextInt();
				n=c;
				System.out.print(n + " ");
			}
			System.out.println();
		}}
	}
}
